import Todo from "./Todo"

function Todos ( props ) {
    let todos = props.todos
    console.log(todos);
    for(let i = 0; i < todos.length; i++) {
        console.log(todos[i]);
    }
}
/*
      <div className="container">
        {movies.map((movie) => (
          <Movie key={movie.imdbID} movie={movie} />
        ))}
      </div>
*/ 
export default Todos
